import ExpenseItem  from "./components/ExpenseItem";


function App() {

  const expenseItems = [
    {title : "car insurance" , amount : 23 , date : new Date(2023,3,5)},
    {title : "bike insurance" , amount : 20 , date : new Date(2023,3,6)},
    {title : "life insurance" , amount : 230 , date : new Date(2023,3,7)},
  ];


  return (
    <div>
      <ExpenseItem title ={expenseItems[0].title} amount ={expenseItems[0].amount}  date={expenseItems[0].date}></ExpenseItem>
      <ExpenseItem title ={expenseItems[1].title} amount ={expenseItems[1].amount}  date={expenseItems[1].date}></ExpenseItem>
      <ExpenseItem title ={expenseItems[2].title} amount ={expenseItems[2].amount}  date={expenseItems[2].date}></ExpenseItem>

    </div>
  );
}

export default App;
